import React from 'react';
import { useCart } from './CartContext';
 import './styles/Produce.css'; // Import CSS file for styles

const Produce = () => {
  const { addToCart } = useCart();
  const produceList = [
    { name: 'Apple', description: 'A crunchy and juicy fruit.', image: 'https://static.vecteezy.com/system/resources/thumbnails/020/899/515/small/red-apple-isolated-on-white-png.png' },
    { name: 'Banana', description: 'A tropical fruit with a yellow peel.', image: 'https://static.vecteezy.com/system/resources/thumbnails/022/948/126/small/cute-happy-banana-character-ai-generated-png.png' },
    { name: 'Carrot', description: 'A root vegetable often used in salads and cooking.', image: 'https://genshinimpact.wiki.fextralife.com/file/Genshin-Impact/carrot-ingredient-genshin-impact-wiki-guide-150-px.png' },
    { name: 'Spinach', description: 'A leafy green vegetable packed with nutrients.', image: 'https://www.alternativephotography.com/wp-content/uploads/2022/08/Spinach-and-Spirulina-Carmen-Ayla-150px.jpg' },
    { name: 'Tomato', description: 'A versatile fruit often used in salads and sauces.', image: 'https://genshinimpact.wiki.fextralife.com/file/Genshin-Impact/tomato-ingredient-genshin-impact-wiki-guide-150-px.png' },
    { name: 'Eggplant', description: 'A fruit? or vegtable not sure, taste good', image: 'https://cdn.shopify.com/s/files/1/2016/2681/products/eggplant-little-finger-purple-com-wm.jpg?v=1626823586?width=150&height=150' },
    { name: 'Peach', description: 'Peaches are soft, juicy fruits with fuzzy skin.', image: 'https://ucsdcommunityhealth.org/wp-content/uploads/2016/07/peach-150x150.jpg' },

  ];

  return (
    <div>
      <h1>Types of Produce</h1>
      <div className="produce-list">
        {produceList.map((produce, index) => (
          <div key={index} className="produce-item">
            <img src={produce.image} alt={produce.name} />
            <h3>{produce.name}</h3>

            <p>{produce.description}</p>
            <button onClick={() => addToCart(produce)}>Add to Cart</button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Produce;
